import React from "react";
import CloseIcon from '@mui/icons-material/Close';

const Modal = ({children}) => {

    return (
        <div className="modal">
            <div className="container">
                <CloseIcon />
                <div className="content">{children}</div>
            </div>
        </div>
    );
};


export default Modal;
